var marcaSelect = document.getElementById("marca");
var modeloSelect = document.getElementById("modelo");
var versaoSelect = document.getElementById("versao");
var alcoolCidadeInput = document.getElementById("alcool_cidade");
var gasolinaCidadeInput = document.getElementById("gasolina_cidade");
var alcoolEstradaInput = document.getElementById("alcool_estrada");
var gasolinaEstradaInput = document.getElementById("gasolina_estrada");

// Função para preencher o select de marca com base no JSON
function preencherMarcas() {
var marcas = modelosJSON.map(function (modelo) {
    return modelo.MARCA;
});

// Remova marcas duplicadas usando um conjunto (Set)
var marcasUnicas = [...new Set(marcas)];

// Ordene as marcas em ordem alfabética
marcasUnicas.sort(function (a, b) {
    return a.localeCompare(b);
});

// Limpe todas as opções existentes no select de marca
marcaSelect.innerHTML = "";

// Preencha o select de marca ordenado
marcasUnicas.forEach(function (marca) {
    var option = document.createElement("option");
    option.value = marca;
    option.text = marca;
    marcaSelect.appendChild(option);
});
}

// Função para preencher o select de modelo com base na marca selecionada
function preencherModelos(marcaSelecionada) {
// Limpe as opções atuais do select de modelo
modeloSelect.innerHTML = "";

// Adicione a opção padrão "Selecione o modelo..."
var defaultOption = document.createElement("option");
defaultOption.value = "";
defaultOption.text = "Selecione o modelo...";
modeloSelect.appendChild(defaultOption);

// Filtrar modelos com base na marca selecionada e manter um conjunto (Set) para evitar duplicatas
var modelosSet = new Set();
modelosJSON.forEach(function (modelo) {
  if (modelo.MARCA === marcaSelecionada) {
    modelosSet.add(modelo.MODELO);
  }
});

// Converter o conjunto de modelos de volta para um array
var modelosUnicos = Array.from(modelosSet);

// Preencha o select de modelo com as opções únicas
modelosUnicos.forEach(function (modelo) {
  var option = document.createElement("option");
  option.value = modelo;
  option.text = modelo;
  modeloSelect.appendChild(option);
});
}

// Adicione um ouvinte de eventos ao select de marca
marcaSelect.addEventListener("change", function () {
var alcool_cidade = document.getElementById("alcool_cidade");
var gasolina_cidade = document.getElementById("gasolina_cidade");
var alcool_estrada = document.getElementById("alcool_estrada");
var gasolina_estrada = document.getElementById("gasolina_estrada");
var versao = document.getElementById("versao");

alcool_cidade.value = null;
gasolina_cidade.value = null;
alcool_estrada.value = null;
gasolina_estrada.value = null;
versao.value=null;

var selectedMarca = marcaSelect.value;
if (selectedMarca === "default") {
  // Selecione "Selecione uma marca primeiro" no select de modelo
  modeloSelect.innerHTML = "";
  var defaultOption = document.createElement("option");
  defaultOption.value = "default";
  defaultOption.text = "Selecione uma marca primeiro";
  modeloSelect.appendChild(defaultOption);
} else {
  // Preencha o select de modelo com base na marca selecionada
  preencherModelos(selectedMarca);
}
});

// Inicialmente, preencha o select de marca
preencherMarcas();


// Dentro do evento do select de modelo
modeloSelect.addEventListener("change", function () {
  var selectedModelo = modeloSelect.value; 
  if (selectedModelo === "default") {
      // Selecione "Selecione um modelo primeiro" no select de versão
      versaoSelect.innerHTML = "";
      var defaultOption = document.createElement("option");
      defaultOption.value = "default";
      defaultOption.text = "Selecione um modelo primeiro";
      versaoSelect.appendChild(defaultOption);
  } else {
      // Preencha o select de versão com base no modelo selecionado
      preencherVersoes(selectedModelo);
  }
});


// Função para preencher o select de versão com base no modelo selecionado
function preencherVersoes(modeloSelecionado) {
// Limpe as opções atuais do select de versão
versaoSelect.innerHTML = "";

// Adicione a opção padrão "Selecione a versão..."
var defaultOption = document.createElement("option");
defaultOption.value = "";
defaultOption.text = "Selecione a versão...";
versaoSelect.appendChild(defaultOption);

// Filtrar versões com base no modelo selecionado
var versoesFiltradas = modelosJSON.filter(function (versao) {
    return versao.MODELO === modeloSelecionado;
});

// Preencha o select de versão com as opções filtradas
versoesFiltradas.forEach(function (versao) {
    var option = document.createElement("option");
    option.value = versao.VERSAO;
    option.text = versao.VERSAO;
    versaoSelect.appendChild(option);
});
}

// Função para preencher as informações com base no modelo e versão selecionados
function preencherInformacoes(versaoSelecionada2, modeloSelecionado) {
console.log("Modelo selecionado:", modeloSelecionado);
console.log("Versão selecionada:", versaoSelecionada2);

// Encontre as informações correspondentes ao modelo e versão selecionados
var informacoes = modelosJSON.find(function (modelo) {
    return modelo.MARCA === marcaSelect.value &&
        modelo.MODELO === modeloSelecionado &&
        modelo.VERSAO === versaoSelecionada2;
});

console.log("Informações encontradas:", informacoes);

if (informacoes) {
    // Preencha os campos com as informações encontradas
    alcoolCidadeInput.value = informacoes["Álcool\nCidade (km/l)"];
    gasolinaCidadeInput.value = informacoes["Gasolina\nCidade (km/l)"];
    alcoolEstradaInput.value = informacoes["Álcool\nEstrada (km/l)"];
    gasolinaEstradaInput.value = informacoes["Gasolina\nEstrada (km/l)"];

    // Atualize a caixa de classificação com base na informação do JSON
    var caixaClassificacao = document.getElementById("cx_classificacao");
    var classificacao = informacoes["Classificação"];
    caixaClassificacao.textContent = classificacao + " - " + getDescricaoClassificacao(classificacao);
    switch (classificacao) {
      case "A":
          caixaClassificacao.style.backgroundColor = "green";
          break;
      case "B":
          caixaClassificacao.style.backgroundColor = "lightgreen";
          break;
      case "C":
          caixaClassificacao.style.backgroundColor = "yellow";
          break;
      case "D":
          caixaClassificacao.style.backgroundColor = "orange";
          break;
      case "E":
          caixaClassificacao.style.backgroundColor = "red";
          break;
      default:
          // Se a classificação não for reconhecida, defina um fundo padrão
          caixaClassificacao.style.backgroundColor = "white";
          break;
  }
  } 
}

// Função auxiliar para obter a descrição da classificação com base na letra (A, B, C, etc.)
function getDescricaoClassificacao(classificacao) {

var descricao = {
    "A": "SUPER ECONÔMICO",
    "B": "ECONÔMICO",
    "C": "POUCO ECONÔMICO",
    "D": "POUCO ECONÔMICO",
    "E": "POUCO ECONÔMICO"
};

if (descricao.hasOwnProperty(classificacao)) {
    return descricao[classificacao];
    
}
}

// Adicione um ouvinte de eventos ao select de versão
versaoSelect.addEventListener("change", function () {
  var selectedModelo = modeloSelect.value; 
  var selectedVersao = versaoSelect.value;
  // Preencha as informações com base na versão selecionada e no modelo selecionado
  preencherInformacoes(selectedVersao, selectedModelo);
});


// Inicialmente, preencha o select de marca
preencherMarcas();

